script: |
  super -f text -I q3185.spq | sort > q3185.out

inputs:
  - name: q3185.spq
    data: |
      SELECT ALL - - 33 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT IN ( + + col2 * col0, - 76, - - col1, col1, - col1, + 73, - col1 );
  - name: tab0

outputs:
  - name: q3185.out
    data: |
